NumericField getNumericField(String name) {
  if (!reuseFields) {
    return new NumericField(name);
  }

  NumericField f = numericFields.get(name);
  if (f == null) {
    f = new NumericField(name);
    numericFields.put(name, f);
  }
  return f;
}

